import React, {Fragment} from 'react';
import Navbar from './components/Navbar/Navbar';
import './App.css';
import Gallerys from './components/Gallery/Gallerys';

function App() {
  return (
    <Fragment>
      <Navbar />
      <div className="gallery"> 
        <Gallerys />
      </div>
    </Fragment>
  );
}

export default App;
